import React from 'react';
import png from './error.png';
export default function ErrorIndicator() {
  return (
    <div className="d-flex ErrorIndicator">
      {png}
      <span>BOOM!</span>
      <span>Something went wrong</span>
      <span>we've already sent droids to fix it</span>
    </div>
  );
}
